import  React, { Component } from "react"
type formId = {
    Id: String
  }
export class FormBuilder extends React.Component<formId> {
    constructor(props){
        super(props);
        this.state = {}
    }
    render() {
      return <h1>{this.state.formId}</h1>;
    }
  }
  export default FormBuilder;
